(function($) {
    
    var awpNLPSearchInit = function(cx, s) {
        
        var block = $('#block-search-form', cx);
        var logo = $('#region-branding', cx);
        var form = $('#search-block-form', cx);
        var nav = $('nav.navigation', cx);
        var formTimer = [];
        
        var setTimer = function() {
            var timer = setTimeout(function() {
                block.removeClass('open');
                logo.removeClass('open');
                nav.removeClass('open');
            }, 5000);
            
            formTimer.push(timer);
        }
        
        var clearTimer = function(reset) {
            for (i in formTimer) {
                clearTimeout(formTimer[i]);
                delete formTimer[i];
            }
            
            if (!!reset) setTimer();
        }
        
        block.click(function() {
            block.addClass('open');
            logo.addClass('open');
            nav.addClass('open');
            setTimer();
            
            $('input', this).on('click keyup', function() {
                clearTimer(true);
            });
        });
    }
    
    Drupal.behaviors.awpNLPSearch = {
        attach: awpNLPSearchInit
    }
    
})(jQuery);
;
(function ($) {

Drupal.behaviors.textarea = {
  attach: function (context, settings) {
    $('.form-textarea-wrapper.resizable', context).once('textarea', function () {
      var staticOffset = null;
      var textarea = $(this).addClass('resizable-textarea').find('textarea');
      var grippie = $('<div class="grippie"></div>').mousedown(startDrag);

      grippie.insertAfter(textarea);

      function startDrag(e) {
        staticOffset = textarea.height() - e.pageY;
        textarea.css('opacity', 0.25);
        $(document).mousemove(performDrag).mouseup(endDrag);
        return false;
      }

      function performDrag(e) {
        textarea.height(Math.max(32, staticOffset + e.pageY) + 'px');
        return false;
      }

      function endDrag(e) {
        $(document).unbind('mousemove', performDrag).unbind('mouseup', endDrag);
        textarea.css('opacity', 1);
      }
    });
  }
};

})(jQuery);
